import './App.css';
import Navbar from './Components/Navbar/Navbar';
import Intro from './Components/Intro/Intro';
import Skills from './Components/Skill/Skill';
import Works from './Components/Work/Work';
import articleBackground from './Components/Particles/particleBackground';

function App() {
  return (
    <div className="App">
      <particleBackground />
      <Navbar/>
      <Intro /> 
      <Skills />
      <Works />
    </div>
  );
}

export default App;
